import React from 'react';
import './whiteBox.css'

const WhiteBox = () => {
    return (
        <div className="WhiteBox">
            <UserName />
            <Profile />
            <UserInfo-Container />
            <Count-Container />
        </div>
    );
}

export default WhiteBox;
